import React, { useState } from 'react'
import { useEffect } from 'react'
import axios from 'axios'

const Book = () => {
    const [books,setBooks] = useState([])

    useEffect(()=>{
        const fetchAllBooks = async ()=>{
            try {
                const res = await axios.get("http://localhost:8800/books")
                console.log(res)
                setBooks(res.data);
            } catch (err) {
                console.log(err);
            }
        }
        fetchAllBooks()
    },[])

  return (
    <div>Book</div>
  )
}

export default Book
